import React from 'react'
import { Link } from 'react-router-dom';

function LandingPage() {
    return (
        <div>
            <header>
                <Link to="" className="header-brand"><img src="/images/Home/" alt="" /></Link>
                <Link to="" className="header-login"></Link>
            </header>
        </div>
    );
}

export default LandingPage;
